import React from 'react';

const HomePage: React.FC = () => {
  return (
    <div className="home-page">
      <header>
        <h1>Premier League TV Schedule UK</h1>
        <p>Find which broadcaster shows every match: Sky Sports, TNT Sports, BBC</p>
      </header>

      <main>
        <div className="wrap">
          <p>React version - Coming soon!</p>
          <p>This will be the new React version of the football fixtures app.</p>
        </div>
      </main>
    </div>
  );
};

export default HomePage;
